import React from 'react';
import { Image, Table } from 'react-bootstrap';
import "./aboutme.css";

export const Info = () => (

    <Table>
        <tr>
            <td></td>
            <td><Image className="headshot" src="selfie1.jpg" rounded /></td>
            <td> Here is some info for ya</td>
            <td></td>
        </tr>
    </Table>

);
